import React from "react";
import { Link } from "react-router-dom";
import { useAuth } from '../../Context/AuthContext';

const Navbar = ({ toggle }) => {
  const { logout } = useAuth();

  const handleLogout = () => {
    logout();
    window.location.href = "/";
  };

  return (

      <nav
      className="navbar navbar-expand-lg navbar-light d-flex justify-content-between col"
      style={{ backgroundColor: "#ececf1" }}
    >
      <div className="container-fluid">
        <div onClick={toggle}>
          <span>
            <i className="bi bi-list h-100 w-100 fs-2 "></i>
          </span>
        </div>

        <nav className="navbar navbar-expand-lg navbar-light">
          <div className="collapse navbar-collapse" id="navbarCollapse">
            <div className="navbar-nav">
              <div className="nav-item  fw-bold">

                  <i className="bi bi-person-circle  fs-2 "> </i>ADMIN
              </div>
            </div>
          </div>
        </nav>
      </div>
    </nav>


  );
};

export default Navbar;
